import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import AdminDashboard from './admin/AdminDashboard';
import MyDossiers from './components/MyDossiers'; 
import PrivateRoute from './auth/PrivateRoute';
import PatientsList from './doctor/PatientsList.js'; // ‚Üê VOTRE CHEMIN EXACT

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Admin */}
          <Route
            path="/admin"
            element={
              <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
                <AdminDashboard />
              </PrivateRoute>
            }
          />

          {/* üöÄ M√âDECIN - FONCTIONNEL */}
         // Dans App.js, remplacez la route m√©decin par :
<Route
  path="/medecin"
  element={
    <PrivateRoute allowedRoles={['Medecin']}>
      <Routes>
        <Route index element={<Navigate to="patients" replace />} />
        <Route path="patients" element={<PatientsList />} />
        {/* Ajoutez apr√®s cr√©ation des fichiers : */}
        {/* <Route path="dossiers" element={<MesDossiers />} /> */}
      </Routes>
    </PrivateRoute>
  }
/>


          {/* Mes Dossiers patients */}
          <Route
            path="/mes-dossiers"
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <MyDossiers />
              </PrivateRoute>
            }
          />

          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
